class User {
  constructor(id, name, email, status, type, password) {
    this.id = id;
    this.name = name;
    this.email = email;
    this.status = status;
    this.type = type;
    this.password = password;
  }

  static state = [];

  static parseData = async () => {
    try {
      const response = await fetch("http://localhost:5000/api/users");
      if (!response.ok) throw new Error("Failed to fetch users");

      const data = await response.json();
      User.state = data.map(
        (u) => new User(u.id, u.name, u.email, u.status, u.type, u.password)
      );
    } catch (error) {
      console.error("Error parsing user data:", error);
    }
  };

  static getUsers = () => {
    return User.state;
  };
}

export default User;
